import { useLocation } from "react-router-dom";
import "./index.less";

const Game = () => {
  const {
    state: { url },
  } = useLocation();
  return (
    <div className="playBox">
      <iframe
        src={url}
        height="100%"
        width="100%"
        scrolling="none"
        frameborder="0"
      ></iframe>
    </div>
  );
};

export default Game;
